import ButtonAppBar from "./ButtonAppBar";
import Box from '@mui/material/Box';

const Notification = () => {
    return (
        <>
            <ButtonAppBar />
            <Box
                sx={{
                    width: 300,
                    height: 150,
                    backgroundColor: 'rgba(255, 255, 255, 0.8)',
                    boxShadow: 'rgba(0, 0, 0, 0.24) 0px 3px 8px;',
                    borderRadius: '20px',
                    margin: 'auto',
                    marginTop: '50px'
                }}>
                    <Typography variant="h5">

                    </Typography>
            </Box>
        </>
    );
}

export default Notification;
